import React from "react";
import {Button} from "@material-ui/core";

function GetFibNum() {
  return (
    <React.Fragment>
      <form name="fib">
        <input type="number" min="1" max="100" placeholder='1' onChange={(e)=>e.target.value}/> <Button>get</Button>
      </form>
      <div>there will be your num</div>
    </React.Fragment>
  );
}

export default GetFibNum;
